class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m=len(board)
        n=len(board[0])
        maxi=-10000000000
        place=[0,0]
        maxcoll=[]
        for i in range(m):
            this=sorted([[board[i][j],j] for j in range(n)],key=lambda x:-x[0])[:3]
            maxcoll.append(this)
        maxi=-10000000000
        for i in range(m-2):
            for j in range(i+1,m-1):
                for k in range(j+1,m):
                    for t in range(3):
                        a=maxcoll[i][t]
                        r_1=a[1]
                        a=a[0]
                        this=maxcoll[j]
                        that=maxcoll[k]
                        if this[0][1]==r_1:
                            b_1=this[1][0]
                            r_21=this[1][1]
                            b_2=this[2][0]
                        elif this[1][1]==r_1:
                            b_1=this[0][0]
                            r_21=this[0][1]
                            b_2=this[2][0]
                        else:
                            b_1=this[0][0]
                            r_21=this[0][1]
                            b_2=this[1][0]
                        if that[0][1]==r_1:
                            c_1=that[1][0]
                            r_31=that[1][1]
                            c_2=that[2][0]
                        elif that[1][1]==r_1:
                            c_1=that[0][0]
                            r_31=that[0][1]
                            c_2=that[2][0]
                        else:
                            c_1=that[0][0]
                            r_31=that[0][1]
                            c_2=that[1][0]
                        if r_21==r_31:
                            now=a+max(b_1+c_2,b_2+c_1)
                        else:
                            now=a+b_1+c_1
                        maxi=max(maxi,now)
        return maxi
